            <h1>Questions?</h1>
            <p>We've got answers</p>
              <div className='questioner'>
                    <select name="" id=""><option>What is Spotify and Spotify Premium?</option></select>
                    <select name="" id=""><option>How do i cancel?</option></select>
                    <select name="" id=""><option>How does the duo and family plan works?</option></select>
                    <select name="" id=""><option>How many devices can i listen to?</option></select>
                    <select name="" id=""><option>How does the student plan work?</option></select>
               </div>

              </div>
            </>
        );
    }


export default Component5;
